import React from 'react'
import Typography from '@material-ui/core/Typography';

export const Title = ({params}) => {
    return (
        <Typography variant="h6" noWrap>
            {    
                (params.idCoownership !== null)
                && params.coownership.name
            }
            {    
                (params.idCoownership === null)
                && params.locals.title
            }
        </Typography>
    )
}
